import styled from 'styled-components';

const MessagesWrapper = styled.div`
  background-color: pink;
`;

const Sender = styled.div`
  font-size: 14px;
  color: grey;
`;

const Message = styled.div`
  background-color: #68d3ed;
  border-radius: 3px;
  color: white;
  font-size: 20px;
  padding: 3px;
  width: fit-content;
`;

export {
  MessagesWrapper,
  Sender,
  Message
}
